"1771638739588\t転生したらウイルスでした　～魔王の体内に侵入して、風邪をひかせて世界を救います～\t異世界のウイルスに転生し、バフやデバフを操って強力な宿主に寄生。家を殺した魔王に怒り魔王の体内に侵入し、白血球とミクロの決死圏バトルを展開。重い風邪を引き起こして魔王を倒す。\t転生, 人外転生, マイクロバトル, 医療\t自我を持ったウイルスとして生物の体内に感染し、能力のバフ・デバフ操作で魔王の免疫細胞とミクロの決死圏バトルを繰り広げる。",
"1771638739588\tハズレスキル【ガチャ】で運命を変える　～初回10連で女神様が出たので、人生イージーモードです～\t【ガチャ】を持つリクが、初回10連で世界を管理する女神アリアを引き当てる。豪運で聖剣等の最強アイテムを次々引き完全なイージーモードに突入し、ガチャの物量で世界最強になる。\t異世界召喚, ガチャ, チート, コメディ\tスキルガチャの初回サービス10連で、いきなりチートアイテムの枠を飛び越えて「世界を管理する女神」そのものを引っ張り出す。",
"1771638739588\t人の頭上に『死亡フラグ』が見えるようになったので、全力でへし折って回ります\t他人の「死亡フラグ」が見えるアキトはフラグ・クラッシャーとして行動。魔王復活による国家滅亡フラグを折るため、敵のフラグを読み取りながら狂信者の儀式を妨害して運命をへし折る。\t現代ファンタジー, 予測, サスペンス, バトル\t他人の頭上に見える詳細な死因のテキストを読み取り、先回りして運命のシナリオを物理的にへし折って世界を変える。",
"1771638739588\t悪役令嬢の罠が高度すぎて、逆に主人公をレベルアップさせてしまう件\tヒロインのアリスが悪役令嬢セシリアから嫌がらせを受けるが、セシリアの完璧主義によりダンジョンは優良レベリング場、毒は万能薬となり、アリスを超強化してしまう奇妙な師弟コメディ。\t転生, 悪役令嬢, 勘違い, コメディ\t悪役令嬢が全力で用意した罠や毒薬が計算されすぎているがゆえに、主人公の最適レベリング場や万能薬として作用してしまう。",
"1771638739588\t回復魔法使いですが、物理で殴って治します　～「痛いの痛いの飛んでいけ」は、痛みを拳に乗せて敵に飛ばす技でした～\t「打撃」によって患部の細胞を活性化させる物理ヒーラーのレオ。味方を殴って全回復させ、吸収したダメージを「ペイン・バースト」として敵に叩き込む撲殺ヒーラー伝説。\tファンタジー, バトル, ヒーラー, コメディ\t治癒魔法の発動条件が「強烈な物理打撃を部位に加えること」であり、怪我人をボコボコに殴り飛ばして全回復させる狂気のヒーラー。",
"1771638739588\tダンジョン・コアに転生したけど、殺し合いは嫌なのでテーマパークを作ります　～入場料は魔力でお願いします～\tダンジョン・コアに転生した平和主義の主人公が、魔導コースター等を作るエンタメ系ダンジョンを構築。ワクワクの感情魔力で大繁盛するが、討伐に来た騎士団には絶叫アトラクションで応戦する。\t転生, ダンジョン運営, 経営, テーマパーク\t血みどろのダンジョンを、感情から抽出する魔力エネルギーで稼働する安全な最先端テーマパークへ大改造する。",
"1771638739588\tスキル【オートマッピング】がバグって、世界中の隠し通路も財宝も全部丸見えなんですけど\tシンの【オートマッピング】がバグり、全世界の未踏マップと宝箱だけでなく国家機密やスキャンダルまでリアルタイム表示されるようになる。情報可視化の力を逆手にとって権力者と交渉していく。\tファンタジー, 探索, チート, 情報戦\tオートマッピング機能がバグって全世界の地形だけでなく、王様の隠し財産や即死罠などの全てがリアルタイム透視状態になる。",
"1771638739588\t勇者に「お前が魔王だろ」と勘違いされましたが、私はただのゴスロリファッション愛好家です\tゴスロリ愛好家を貫く少女ルナが、その見た目から勇者に「魔王」と誤解される。防犯ブザーや着せ替え人形で無自覚に勇者を退け、魔族からも新魔王と崇拝されて世界をカワイイで征服する。\t転生, 勘違い, コメディ, 日常\tただの重度なゴスロリ厨二病ファッションが、異世界の勇者から「漆黒の呪いを纏った魔王」として100％ガチで勘違いされる。",
"1771638739588\t異世界で現代兵器を召喚できるようになったけど、全部エアガンでした　～BB弾でドラゴン倒せるわけないだろ！……あれ？～\t【武器召喚】でエアガンしか出せないミリタリー好きケンジが、BB弾に爆発魔力を付与して実弾以上の威力を発揮。土魔法で無限弾薬を作り、FPS装備で魔法使いやドラゴンをミニガンで蹂躙する。\t異世界転移, ガンアクション, ミリタリー, 無双\t召喚したおもちゃのエアガンのBB弾に「爆発魔力」をエンチャントし、反動ゼロの実質的な連射ロケットランチャーとして乱射する。",
"1771638739588\tホラーゲームの幽霊に転生したけど、プレイヤーがビビリすぎてゲームが進まない\tVRホラーの怨霊に転生した主人公だが、挑戦するプレイヤーたちが悉くビビリで進行不能に。血文字でヒントを出し優しくサポートした結果、「萌えキャラ」として愛されるアイドルホラーゲームに変貌する。\t転生, ホラー, VRゲーム, コメディ\tホラーゲームの怨霊になったが、遊ぶプレイヤーが腰を抜かして進まないため、物理的に背中を押したりして手厚くサポートする。",
"1771638739588\t勇者召喚は罠でした　～魔力電池として繋がれた俺たちが、国を停電させて脱出するまで～\tクラスごと召喚された魔導国家で生体魔力電池として拘束されたカズマ達。【電気操作】スキルでシステムを逆流させ魔力を暴走させて城のブレーカーを落とし、警備をスクラップにして脱出する。\t異世界召喚, SFファンタジー, バトル, 脱出劇\t勇者召喚の実態がマトリックスのような生体魔力電池であり、電気操作スキルで城のブレーカーを落として大脱走を図る。",
"1771638739588\t異世界に原子力潜水艦ごと転移した提督、海賊を殲滅して海の覇者になる\t原子力潜水艦ごと異世界の海へ転移した東郷艦長。魔法も届かない位置から魚雷で海賊船を粉砕し、海竜王の艦隊に対しても核融合炉の超長距離ミサイルで応戦し、科学の力で海の覇権を握る。\t異世界転移, 架空戦記, ミリタリー, 無双\t大航海時代にある異世界に最新鋭の原子力潜水艦が現れ、魔法が届く前にソナーと超長距離魚雷で敵艦隊を一方的に海の藻屑にする。",
"1771638739588\t聖女様はネクロマンサー　～「蘇生魔法」の正体が「死体操作」だとバレないように必死です～\t奇跡の蘇生聖女の正体は、死体をネクロマンサーの糸で操作して生きてるフリをさせる天才人形使いエレノア。勇者の腐敗防止を隠蔽する中、魔王に同志と目をつけられ火刑綱渡りが始まる。\tファンタジー, ダークコメディ, 勘違い, 偽装\t最強の蘇生魔法を使う聖女の正体が死体愛好家のネクロマンサーであり、蘇生した勇者は全て糸で裏から操っているマリオネット。",
"1771638739588\t異世界バトルロイヤルのNPCに転生したけど、安全地帯を知ってるので最後まで生き残ります\t神々のデスゲームの「村人A（モブNPC）」に転生した主人公。前世の知識で安置や毒ガス情報を把握し挑戦者を同士討ちさせ安全に生き残り、最後の勝者となって運営の神をぶっ飛ばそうとする。\t転生, デスゲーム, 下剋上, 頭脳戦\tバトルロイヤルゲームのただの「モブ村人」として参加し、毒ガス範囲などを熟知したチートメタ知識により漁夫の利を得る。",
"1771638739588\t死に戻りスキル【セーブ＆ロード】で、魔王を倒すまで１００万回死にました　～今さら土下座されても許しません～\t戦闘力皆無の勇者ミナトが【セーブ＆ロード】で100万回の死を超え敵の予備動作を完全に記憶。魔王のまばたき一つまで見切り、絶望の中で命乞いする魔王を冷徹に攻略する死に戻りの復讐劇。\tファンタジー, ループ, ダーク, 無双\t1発食らえば死ぬ虚弱体質ながら、100万回のセーブ＆ロードで魔王の予備動作まで見切る究極の死神と化す。",
"1771638739588\tパーティを追放されたので、魔物労働組合（モンスターユニオン）を結成し、ストライキを起こしました\t勇者パーティを追放されたゲンが、魔王軍で酷使されるゴブリンたちに「労働組合」を教えストライキを決行。魔王軍の機能が麻痺して賃上げ交渉に成功し、勇者たちもレベル上げ不能に陥る。\tファンタジー, 内政, コメディ, 労働\t魔王軍でパワハラ労働させられている魔物たちに「労働基準」と「スト」を教え込み、魔王軍の軍事機能を物理的に完全停止させる。",
"1771638739588\tこの世界はシミュレーションだと気づいた俺、開発者用コンソールを見つけて神になる\t世界がシミュレーションだと気づいたソウタが、開発コンソールの神コマンドで無双。システム管理者にBANされそうになるが、人類を守るため全住民に管理者権限を付与し運営と戦争する。\tSFファンタジー, チート, メタフィクション, バトル\t現実のシミュレーションである異世界でデバッグの神コマンドを直打ちし、世界の物理法則を無視して運営と戦う。",
"1771638739588\t最弱スライムに転生したと思ったら、進化先がクトゥルフ神話の邪神ばかりだった件\tスライムの進化先がショゴスなどのSAN値直葬の邪神ツリーだった主人公。周囲に精神汚染を引き起こし勇者も信者になる始末。本人の意思に反して世界を狂気に染め上げるクトゥルフ異世界ファンタジー。\t転生, クトゥルフ神話, 勘違い, ダーク\tスライム進化の分岐がすべてクトゥルフ系冒涜生物であり、存在自体が周囲を発狂させてカルト教団を作ってしまう。",
"1771638739588\t「異世界転生ブームは終了しました」　女神が転生ゲートを閉鎖した結果、溢れかえる転生者たちのサバイバル\t女神のサービス終了宣言により転生者たちのチート能力が全剥奪される。無職のタケルが旧チート転生者たちをまとめあげ、前世の知恵のみで現代都市を構築するチート無しの本当の異世界サバイバル。\t異世界サバイバル, 内政, 建国, 群像劇\tチート能力を没収された元最強主人公たちが、科学技術と知恵だけで都市を築き上げ再起を図るリアルなサバイバル劇。"
